import { useState } from 'react';
import styled from 'styled-components';

export const FooterWrapper = styled.div`
  padding: 0px 0px 0px 0px;
  width:100%;
  height:30vh;
  background:pink;
`;



const Footer = () => {
 
    return (  
        <>
          <FooterWrapper>

          </FooterWrapper>
        </>
    );
}
 
export default Footer;
